let info=[
    {
        "org": "Capgemini",
        "locations":["Bangalore","Hyderbad","Pune"],
        "employee": 500000,
        "basic":3.5,
        "services": ["app","test",],
        "benchmarks":["abcd","xyz"]
    },
    {
        "org": "Infosys",
        "locations":["Bangalore","Hyderbad","Pune"],
        "employee": 500000,
        "basic":3.8,
        "services": ["ITR Software","test",],
        "benchmarks":["efgh","uvw"]
    },
    {
        "org": "IBM",
        "locations":["Bangalore","Hyderbad","Pune"],
        "employee": 500000,
        "basic":4.1,
        "services": ["app","test",],
        "benchmarks":["defg","txt"]
    }
]
    
const putting=(obj)=>{
    info.push(obj)
    alert("New Corporate added")
}

const getting=(name)=>{
    info.map((elem)=>{
        if(elem.org===name)
            return elem
    })
}

const byPos=(index)=>{
    if(index<info.length())
        return info[index]
    else
        return index+" is not match in directory"
}

export {putting}
export default info;
